import React, {useState} from 'react';


function App() {
  const [numero1, setNumero1] = useState(null);
  const [numero2, setNumero2] = useState(null);
  const [operador, setOperador] = useState('');
  const [resultado, setResultado] = useState(0);

  const uno = {valor: 1, str: '1'};
  const dos = {valor: 2, str: '2'};
  const tres = {valor: 3, str: '3'};
  const cuatro = {valor: 4, str: '4'}; 
  const cinco = {valor: 5, str: '5'};
  const seis = {valor: 6, str:'6'};
  const siete = {valor: 7, str: '7'};
  const ocho = {valor: 8, str:'8'};
  const nueve = {valor: 9, str:'9'}; 
  const cero = {valor: 0, str:'0'};

  const actualizar = () =>{

  }

  const guardar_num = (e) => {
    if(numero1 === null){
      setNumero1(e.target.value.valor);
      setResultado(e.target.value.str);
    }
    else{
      setNumero2(e.target.value.valor);
      setResultado(e.target.value.str); 
    }
  };

  const operacion = (o) =>{
    setOperador(o.target.value)
  }

  const realizar = () =>{
    const op = operador;
    if(op === '-'){
      setResultado( numero1 -  numero2);
    }
    else if( op === '+'){
      setResultado( numero1 + numero2);
    }
    else if( op === '*'){
      setResultado( numero1 + numero2);
    }
    else if( op === '/'){
      setResultado( numero1 / numero2);
    }
    else{
      setResultado('*INGRESE UNA OPERACION VALIDA*');
    }
  }

  return (
    <>
      <h1>Calculadora</h1>
      <input onChange={actualizar} type='text' value={resultado}></input>
      <div>
        <table>
          <tr>
            <td>
              <button onClick={guardar_num} value={siete}>7</button>
            </td>
            <td>
              <button onClick={guardar_num} value={ocho}>8</button>
            </td>
            <td>
              <button onClick={guardar_num} value={nueve}>9</button>
            </td>
            <td>
              <button onClick={operacion} value='-'>-</button>
            </td>
          </tr>
          <tr>
            <td>
              <button onClick={guardar_num} value={cuatro}>4</button>
            </td>
            <td>
              <button onClick={guardar_num} value={cinco}>5</button>
            </td>
            <td>
              <button onClick={guardar_num} value={seis}>6</button>
            </td>
            <td>
              <button onClick={operacion} value='+'>+</button>
            </td>
          </tr>
          <tr>
            <td>
              <button onClick={guardar_num} value={uno}>1</button>
            </td>
            <td>
              <button onClick={guardar_num} value={dos}>2</button>
            </td>
            <td>
              <button onClick={guardar_num} value={tres}>3</button>
            </td>
            <td>
              <button onClick={operacion} value='*'>*</button>
            </td>
          </tr>
          <tr>
            <td>
              <button onClick={guardar_num} value={cero}>0</button>
            </td>
            <td>
              <button onClick={realizar} value='='>=</button>
            </td>
            <td>
              <button onClick={operacion} value='/'>/</button>
            </td>
          </tr>
        </table>
      </div>
    </>
  )
}

export default App
